package jumbo.euro.demoEuro.model.extern;


public class CancelTerm {
	
	private String	feccan;

	private Double	impcan;

	private String	porcan;

	private String	aplcan;

	
	public String getFeccan() {
		return feccan;
	}

	
	public void setFeccan(String feccan) {
		this.feccan = feccan;
	}

	
	public Double getImpcan() {
		return impcan;
	}

	
	public void setImpcan(Double impcan) {
		this.impcan = impcan;
	}

	
	public String getPorcan() {
		return porcan;
	}

	
	public void setPorcan(String porcan) {
		this.porcan = porcan;
	}

	
	public String getAplcan() {
		return aplcan;
	}

	
	public void setAplcan(String aplcan) {
		this.aplcan = aplcan;
	}
	
	

}
